`,readingTime:{minutes:.06,words:19},title:"",type:"article",s:"202008161438标签的应用 by Ryooo"}}],["/09%20%E7%A2%8E%E8%AE%B0/202008261245%E5%AD%A6%E6%9C%AF%E7%A0%94%E7%A9%B6%E8%A7%92%E5%BA%A6%E8%BF%98%E6%98%AF%E9%80%89%E6%8B%A9%E4%B8%80%E6%AC%BE%E9%95%BF%E6%9C%9F%E8%BD%AF%E4%BB%B6%20by%20%E8%90%BD%E5%B1%B1%E9%B8%A1.html",{loader:()=>I(()=>import("./202008261245学术研究角度还是选择一款长期软件 by 落山鸡.html-CJYfNIhY.js"),[]),meta:{date:1761737537e3,excerpt:`<p>从学术研究角度还是选择一款长期软件<br>
wolai是不错，再看看吧。我的意思是：ob其实很不错了，完善了zk软件的功能，已经可以满足学术和研究的需求。软件的稳定性、长久性、数据的安全性是知识管理重要的一环，zk软件在数十年的迭代中都能稳定向上向下兼容，保证了在我们一个学术周期内的安全使用。<br>
wolai这类软件，导出的格式还不具有可兼容性，如果在之后更换平台，我们的笔记重新规整就很麻烦。<br>
发出上面的感慨，其实也是方便大家选择软件，对ob的期望不要太高，他可能更像一款上世纪的软件，纯文本、记事本。但ob能完成很多的事情，对学术研究是足够的。<br>
